import json
from Crypto.Cipher import DES
import base64
from Crypto.Util.Padding import unpad

# 返回的加密数据
text = ('JwdsCjMM05e4niaZd3zOKXjfJCSKzfLUd1joO6+H0TGjmj0y4AzXIiFlVNgGu02jgC3gC1PksWAGf5'
        '/YNGbTQEyAC0Ga7SkYKJNKFwEmQycDZNsW5BftyP5G/ea'
        '+css5EDpX5nE5rletJJwsjMNrI7we2kDnQa4IhKaNKjGsAZVGtb6wB0bTSlNqe0RT2Cp+Dq'
        '+K8xTis4rkm2YN36zAPIv4AWDO8z9992hOYvvvUQzWU19KrdKBaU1h4alT1JB'
        '')

# 创建DES对象
des = DES.new(key=b'1qaz@wsx', mode=DES.MODE_ECB)
# base64解码
bs = base64.b64decode(text.encode('utf-8'))
# 解密
result = des.decrypt(bs)
result = unpad(result, 8).decode('utf-8')

# print(result)
dic = json.loads(result)
print(dic)

